import {Grid, Input, TextareaAutosize} from "@mui/material";
import * as React from "react";


const TaskMainContent = () => (

	<Grid
		xs={12}
		sm={12}
		lg={12}
		md={12}
		item
		container
	>
		<Grid
			xs={6}
			sm={6}
			lg={6}
			md={6}
			item
		>
			<TextareaAutosize
				aria-label="minimum height"
				minRows={3}
				placeholder="Minimum 3 rows"
				style={{ width: 200 }}
			/>
		</Grid>
		<Grid
			xs={6}
			sm={6}
			lg={6}
			md={6}
			item
		>
			STATUS HISTORY
		</Grid>
	</Grid>
);

export default TaskMainContent;
